import React from "react";
import styled from "styled-components";

const Boxes = styled.div`
  background-color: gray;
  height: 210px;
  width: 210px;
  margin-top: 150px;
  margin-left: 90px;
  /* position: absolute ; */
  cursor: pointer;
  transition: 0.5s ease-in-out;
  border-radius: 10px;

  &:hover {
    background-color: white;
    box-shadow: 1px 1px 30px #343b7c;
  }
`;
const Title = styled.h3`
  font-size: 24px;
  text-align: center;
  color: black;
`;
const Box = ({ item }) => {
  return (
    <Boxes>
      <motion.div>
        <Title>{item.title}</Title>
        <motion.h2></motion.h2>
      </motion.div>
    </Boxes>
  );
};

export default Box;
